import React from 'react'
import Sidebar from '../Navbar/Sidebar'
import SearchSection from './SearchSection'
import { Link } from 'react-router-dom'
const SearchPage = () => {
  return (
    <Link to={'/search/abc'}>
        <Sidebar/>
        <SearchSection/>
    </Link>
        
      
    
  )
}

export default SearchPage
